import React from "react";

const Contact = () => {
  return (
    <div className="max-w-7xl mx-auto p-6">
      <h1 className="text-2xl font-bold mb-4">İletişim</h1>
      <p>
        Buraya iletişim bilgileri veya iletişim formu gelecek.
      </p>
    </div>
  );
};

export default Contact;
